import cheerio from "cheerio";
import fs from "fs";

import places from "./datas/places.json";

var allplaces = places["投開票所"].map(function(m){
  return JSON.parse(JSON.stringify(m));
});

var placeMap = allplaces.reduce(function(now,next){
  now[next.cityname] = now[next.cityname] || {};
  now[next.cityname][next.areaname] = now[next.cityname][next.areaname] || [];

  var ifexist = now[next.cityname][next.areaname]
    .filter((n)=> n.voteplacenumber == next.voteplacenumber).length;

  if(ifexist == 0 ){
    now[next.cityname][next.areaname].push(next);
  }
  
  return now;
},{});


var readfile = function (url,folder){
  var filename = url.split("zh_TW")[1].substring(1);
  filename = filename.replace(/\//gi,"-");

  if(fs.existsSync("processed/"+folder+"/"+filename)){
    return JSON.parse(fs.readFileSync("processed/"+folder+"/"+filename));
  }

  if(!fs.existsSync("crawl_results/"+folder+"/"+filename)){
    return null;
  }
  return fs.readFileSync("crawl_results/"+folder+"/"+filename);
};

var writeFile = function(url,folder,data){
  var filename = url.split("zh_TW")[1].substring(1);
  filename = filename.replace(/\//gi,"-");

  return fs.writeFileSync("processed/"+folder+"/"+filename,data);
}

function parseTable(content,type){
  var $ = cheerio.load(content);

  var tb = $(".tableT");

  tb.find("* table").remove();

  var items = [];
  tb.find(".trT").each(function(ind,dom){
    var tds = $(dom).find("td");
    var status = "";
    if(tds.eq(0).text().indexOf("◎") != -1){
      status =1;
    }else if(tds.eq(0).text().indexOf("？") != -1){
      status =2;
    }else{
      status = 0;
    }
    if(type == "政黨票不分區"){
      return items.push({
        s:status,
        n:tds.eq(0).text(),
        name:tds.eq(1).text(),
        cnt:tds.eq(2).text(),
        p:tds.eq(3).text()
      });
    }else{
      items.push( {
        s:status,
        n:tds.eq(1).text(),
        name:tds.eq(2).text(),
        g:tds.eq(3).text(),
        c:tds.eq(4).text(),
        p:tds.eq(5).text(),
        pt:tds.eq(6).text().replace("推薦","").trim()
      });
    }
  });
  return items;

}


